import rangeDate from "../utils/rangeDate"

const Days = () => {
  const data = rangeDate(1, 16)

  return (
    <div className="frame">
      {data.map((el, i) => {
        return (
          <div className="day" key={i}>
            {el}
          </div>
        )
      })}
      {new Date().getDate}
    </div>
  )
}

export default Days
